import React from 'react';
import './styles.css';

const contact = {
    backgroundColor: "#001f3f",
    width: "100%"
}

export default function Contact() {
    return (
        <div className="Body">
            <div style={contact}>
                <h4>Nikolaj Johannes Skole Jensen</h4>
                <h5>nikolajjsj@gmail.com</h5>
                <h5>nikolaj.app.dev@gmail.com</h5>
            </div>
        </div>
    )
}
